Defendant Justin C Laboy in court with attorney J Anthony Rosario.  Pablo Galaviz appeared for the State of Wisconsin.  State presents sentencing arguments.  Defense presents sentencing arguments.  The defendant was sentenced as follows:

IMPOSED AND STAYED SENTENCE OF:   

4 YEARS IMPRISONMENT - STAYED
  -  2 YEAR(S) OF INITIAL CONFINEMENT
  -  2 YEAR(S) OF EXTENDED SUPERVISION

TERM OF PROBATION:  3 YEAR(S);

CONDITIONS OF PROBATION:  
*AODA Assessment and follow through with any treatment recommended;
*Absolute Sobriety;  Random U.A.'s ; 
*No Use or Possession of alcohol, controlled substances or drug paraphernalia;
*No Use or Possession of prescription drugs without a valid prescription;
*Follow through with any treatment and/or counseling recommended by Agent;
*Maintain full time employment and/or combination of schooling; 
*No contact with:  victims or witnesses in this action;
*DNA sample to be provided if not yet previously done.

RESTITUTION:  to be determined (to be paid as a condition of probation - restitution to be paid before costs or fines);

COURT COSTS:  $268.00 (apply cash bail - balance to be paid within 90 days);

DNA SURCHARGE:  $250.00 (apply cash bail - balance to be paid within 90 days);

CONDITION TIME: 6 MONTHS.  First 3 months jail - straight (Credit - 110 days); second 3 months Huber with release for work, school and/or treatment.  Agent to determine with or without non working hours.  Defendant to report to Huber no later than 6:00 p.m. on December 26, 2016.  

IF REVOKED:
Defendant is not eligible for Challenge Incarceration Program.
Defendant is eligible for Substance Abuse Program.

Felony warnings, voting rights and firearms warnings given.  Restitution hearing scheduled for February 16, 2017 at 02:30 pm.
